import React, {Component} from 'react';
import students from '../mock-data/students.json';

class Grid extends Component {

    state = {
        students: []
    }

    render() {
        return (
            <div className = 'Grid'>
                {students.map((studentItem, index)=>{
                    return <p>{studentItem.name}</p>
                })}
            </div>
        )
      }
}
export default Grid;
